window.bookSummaryJSON = "<b>Follow the gentlemen of the Tenet Club-- an elusive group of noblemen that investigates crimes committed by the nobility-- on a rousing journey of romance, suspense, and a guaranteed happily ever-after.<br><br>Sir Jack Sterling </b>is on the trail of a cagey spy, He follows a lead to a masquerade where a moonlight garden--plus an inebriated heiress--equals trouble to more than his investigation.<br><br><b>Miss Rachel Farnsworth</b> has vowed never to wed, preferring her freedom to an oppressive marriage. While at a masquerade, she steals a kiss from a masked stranger that awakes something deep inside her — a desire for true passion.<br><br>Jack has no room in his volatile life for a woman, no matter how desirable she might be. Until the spy threatens Rachel's life. Following a trail of deception and lies, Rachel joins Jack on his quest to reveal the identity of the traitor.<br><br>Will more than their lives be in danger, or will they lose their hearts as well–to each other?<br><br><br>***PLEASE NOTE*** Love, Lies, and Treasonous Spies was previously published as The Naughty Heiress, Order of the Tenet Regency Romance. This book has undergone extensive edits with new content."; 
